import React from 'react';
import "./aside.css"
import avatarImagem from 'https://cdn.psychologytoday.com/sites/default/files/styles/article-inline-half-caption/public/field_blog_entry_images/2018-09/shutterstock_648907024.jpg?itok=0hb44OrI'

const Aside = () => (
    <aside>
        <div className="avatarContainer">
            <div className="avatarImagem" style={ sectionStyle } >
            </div>
        </div>
    </aside>
);

var sectionStyle = {
    width: "100%",
    height: "400px",
    backgroundImage: "url(" + { avatarImagem } + ")"
};    


export default Aside;
